INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (2, "人助け、応援", 8, 100101, "獣人族", "東山奈央", 44, 155, "ヒヨリ", 16, 27, "A", "人助けが大好き！　前向き格闘娘", 0, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "トゥインクルウィッシュ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (2, "料理、人間観察", 4, 100201, "ヒューマン", "種田梨沙", 47, 158, "ユイ", 17, 5, "O", "戦闘のサポートが得意な、心優しい少女", 0, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "トゥインクルウィッシュ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (2, "読書、乗馬、お茶", 1, 100301, "魔族", "早見沙織", 46, 163, "レイ", 18, 12, "B", "クールで何事にも真っ直ぐな剣士", 0, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "トゥインクルウィッシュ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (5, "いたずら、探検", 8, 100401, "ヒューマン", "諸星すみれ", 27, 128, "ミソギ", 9, 10, "O", "探検好きのイタズラっ子", 0, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "リトルリリカル");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (8, "ヒーローごっこ", 11, 100501, "獣人族", "下田麻美", 40, 146, "マツリ", 12, 25, "O", "ヒーローに憧れる騎士見習いの少女", 0, "？？？", "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (7, "サックス", 11, 100601, "魔族", "浅倉杏美", 42, 150, "アカリ", 13, 22, "O", "甘え上手なみんなの人気者", 0, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (7, "プリンを食べること", 1, 100701, "魔族", "雨宮天", 32, 130, "ミヤコ", 14, 23, "B", "プリン大好きゴースト娘", 0, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (15, "鏡で自分を見ること", 10, 100801, "エルフ", "大空直美", 40, 150, "ユキ", 14, 10, "AB", "ボクは誰よりも美しい", 0, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (13, "小説執筆", 7, 100901, "魔族", "髙野麻美", 45, 159, "アンナ", 17, 5, "A", "前世を信じる中二病患者、「疾風の冥姫」", 0, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "トワイライトキャラバン");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (10, "空想、ぬいぐるみ集め", 9, 101001, "獣人族", "内田真礼", 42, 155, "マホ", 16, 22, "O", "マホマホ王国のプリンセス", 0, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "自警団（カォン）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (3, "お裁縫", 8, 101101, "ヒューマン", "阿澄佳奈", 44, 156, "リノ", 15, 25, "A", "人懐っこくてマシンガントークな妹系少女", 0, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "ラビリンス");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (6, "妹と遊ぶこと、二度寝、昼寝、早寝", 12, 101201, "エルフ", "大橋彩香", 46, 156, "ハツネ", 17, 24, "A", "みんなのために超能力を使う眠り姫", 0, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "フォレスティエ");
