INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (14, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 8, 101801, "魔族", "伊藤静", 52, 162, "イオ", 23, 14, "B", "多くの男性を魅了する無垢な女教師", 0, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "ルーセント学院");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (5, "かわいいもの集め", 4, 102001, "獣人族", "日高里菜", 21, 117, "ミミ", 10, 3, "O", "お歌もにんじんも、ウサギさんも大好き♪", 0, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "リトルリリカル");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (9, "観劇、おままごと", 6, 102101, "ヒューマン", "植田佳奈", 40, 150, "クルミ", 12, 9, "B", "泣き虫で臆病な守ってあげたい女の子", 0, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "サレンディア救護院");
