INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (9, "屋内でできる遊び", 5, 102301, "ヒューマン", "芹澤優", 38, 148, "アヤネ", 14, 10, "B", "ぷうきちといつも一緒！", 0, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "サレンディア救護院");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (9, "ご奉仕", 12, 102501, "ヒューマン", "悠木碧", 43, 154, "スズメ", 15, 12, "O", "お嬢さまのためにがんばるドジっ娘メイド", 0, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "サレンディア救護院");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (11, "あんパン", 1, 102601, "獣人族", "小岩井ことり", 42, 144, "リン", 17, 1, "B", "遊びと睡眠が何より大事なぐうたら娘", 0, "test", "牧場（エリザベスパーク）");
