INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (4, "舞台鑑賞、ダンス", 1, 102901, "ヒューマン", "日笠陽子", 40, 157, "ノゾミ", 17, 24, "B", "歌って踊れる大人気アイドル", 0, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "カルミナ");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (15, "忍法開発", 8, 103001, "ヒューマン", "佐藤聡美", 51, 163, "ニノン", 16, 31, "O", "トーゴクの神秘、オシエテクダサイ！", 0, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (7, "占い", 12, 103101, "魔族", "大坪由佳", 42, 157, "シノブ", 18, 22, "AB", "占いが得意な霊能少女", 0, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (12, "慈善事業", 3, 103201, "ヒューマン", "松嵜麗", 45, 157, "アキノ", 18, 12, "AB", "一人前の商人を目指すパワフルお嬢様", 0, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "メルクリウス財団");
