INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (12, "ウインドーショッピング", 3, 103401, "エルフ", "今井麻美", 55, 164, "ユカリ", 22, 16, "A", "純情でほっとけない大人の女性", 0, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "メルクリウス財団");
