INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (6, "友達作りのイメトレ", 6, 104001, "エルフ", "花澤香菜", 44, 158, "アオイ", 13, 6, "AB", "「友達」に憧れる、エルフの森の女の子", 0, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "フォレスティエ");
