INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (7, "世界征服", 5, 104401, "魔族", "丹下桜", 50, 172, "イリヤ", "??", 5, "A", "かつては夜を支配した最強の吸血鬼", 0, "test", "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (15, "小説を読むこと", 11, 104501, "ヒューマン", "長妻樹里", 49, 157, "クウカ", 18, 19, "AB", "妄想大好き！　ほんとは照れ屋な女の子", 0, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "ヴァイスフリューゲル　ランドソル支部");
