INSERT INTO `v1_9748447c1ae5e0b058266a822e905fbec1bd39f6d3137e5dfd103835e29d7b9c` VALUES (8, "格闘技、湯浴み", 10, 104701, "ヒューマン", "川澄綾子", 50, 171, "ジュン", 25, 25, "A", "素顔を見せない冷静沈着な女性騎士", 0, "？？？", "王宮騎士団（NIGHTMARE）");
